//DEV-NOTE: add specific viewBox values for any SVGs that don't have the square ratio of the standard icons
export const getSVGViewBox = (SVGName: string) => {
	switch (SVGName) {
		case LOGO_KEYS.SKF:
			return '0 0 44 60';
		case LOGO_KEYS.CARITAS_WHITE:
			return '0 0 60 60';
		case LOGO_KEYS.SKM:
			return '0 0 60 46';
		case LOGO_KEYS.IN_VIA:
			return '0 0 54 60';
		case LOGO_KEYS.KREUZBUND:
			return '0 0 62 60';
		case LOGO_KEYS.RAPHAELSWERK:
			return '0 0 391 391';
		default:
			return DEFAULT_SVG_VALUES.ICON_VIEWBOX;
	}
};

